import React from 'react';
import { images } from '../../constants';
import './SpecialMenu.css';

const SpecialMenu = () => (
  <div className='card-container'>
    <img src= {images.himachali_thali/300/200} alt="about_himachali_thali" className='himachali_thali_image'/> 
    <h1 className='card-title'>Card Title</h1>
    <p className='card-description'>
      this is the description of the himachali thali and what is served inside the thali and what you qould like to eat.
    </p>
    <button type="button" className="custom__button">Order</button>
  </div>
);

export default SpecialMenu;
